// Generate a random value between 5 and 20
var value = 5 + Math.random() * 15; // 15 = (20 - 5)
var multiplier = Math.pow(10, 2 || 0);
value = Math.round(value * multiplier) / multiplier;

// Ensure the value stays within the range 5 to 20
if (value < 5) {
    value = 5;
} else if (value > 20) {
    value = 20;
}
return value;

